import React from 'react';
import Item_Card from '../item_Card/index';

const Item_List = ({ products }) => {
    return (
        <>
            {products.map((product) => (
                <Item_Card key={product.id} product={product} />
            ))}
        </>
    );
}

export default Item_List;
